import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`


    display: grid;
    justify-content: center;
    margin-top: 10%;


.hey{
	font-size:3vw;
	font-family:'Permanent Marker';
	line-height:1.5em;
	background-color: white;
  	color: black; 
  	font-weight: bold;
  	margin: 0 auto;
  	padding: 10px;
  	width: 50%;
  	text-align: center;
  	position: absolute;
  	top: 50%;
  	left: 50%;
  	transform: translate(-50%, -50%);
  	mix-blend-mode: screen;
}
.name{

	font-family:'Gochi Hand';
	font-size:4vw;
}
`;

function Home() {
	return(
		<Styles>

		<h3 className='hey'>Hey!</h3>
		<span>How's it going?</span><br/>
		I am <span className='name'>Bimarsha Khanal</span>.<br/>
		Computer Engineering | Technophile | Autodidact


		</Styles>

		);
}

export default Home;
